custom:on_save_triggeritem.xfdl:compute:


// If triggeritem event fires and Save button is on 

((toggle(global.global.triggeritem) == '1') and (strrstr(global.global.triggeritem, 'SAVE_BUTTON') != '-1')) 

   // Save the name of the first form page... and if the URL is empty 

   ? set('custom:triggeritem_page', substr(global.global.triggeritem, '0', strstr(global.global.triggeritem, '.') - '1')) 

   +. (custom:url == '') 

      // Then form is an offline form, so save the state information, set Open State off, then save the form 

      ? set('custom:force_offline_event', 'on') 

      +. set(custom:triggeritem_page +. '.SAVE_ACTION.activated', 'on') 

      // Else if online form, check connection (HTTP) status for 200 or 401, then submit the form 

      : army_package.checkConnection(custom:check_connection_url, 'PAGE1.TOOLBAR_GLOBALS.custom:check_connection_result') 

      +. ((custom:check_connection_result == '200') or (custom:check_connection_result == '401')) 

         // URL exists and connection is ok, so submit the form 

         ?  set('custom:save_button_activated', 'off') +. set('custom:save_event', 'on') 

         // URL exist, but not connected so prompt to save locally 

         : (viewer.messageBox(pecs:noConnectionText, 'WARNING', 'OKCANCEL | ICONWARNING') == '1') 

            // user selected 'OK', so save the state information, set Open State off, then save the form 

            ? set('custom:force_offline_event', 'on') 

            +. set(custom:triggeritem_page +. '.SAVE_ACTION.activated', 'on') 

            // user selected 'Cancel', so do nothing 

            : '' 

// not activated; do nothing 

: ''

custom:after_save.xfdl:compute:


// After Save button fires and only if the URL has been cleared 

toggle(custom:save_button_activated, 'on', 'off') == '1' and custom:url == '' 

   // Restore url and state information then clear temp variables  

   ? set('custom:restore_online_event', 'on') 

   : ''

pecs:before_saveas.xfdl:compute:


// Before SaveAs button fires  

toggle(custom:saveas_button_activated, 'off', 'on') == '1' 

   // Save url and state information then clear the url and set Open State off  

   ? set('custom:force_offline_event', 'on') 

   : ''

custom:after_saveas.xfdl:compute:


// After SaveAs button fires 

toggle(custom:saveas_button_activated, 'on', 'off') == '1' 

   // Restore url and state information then clear temp variables 

   ? set('custom:restore_online_event', 'on') 

   : ''

custom:before_email.xfdl:compute:


// Before Email button fires  

toggle(custom:email_button_activated, 'off', 'on') == '1' 

   // Save url and state information then clear the url and set Open State off 

   ?  set('custom:force_offline_event', 'on') 

   : ''

custom:after_email.xfdl:compute:


// After Email button fires  

toggle(custom:email_button_activated, 'on', 'off') == '1' 

   // Restore url and state information then clear temp variables 

   ?  set('custom:restore_online_event', 'on') 

   : ''
